import React from 'react'
import {Link} from "react-router-dom"

const TestData = {
  "lol":[
  {
    "id": 1,
    "testName": "Are you seek?",
    "description": "Yes"
  },
  {
    "id": 3,
    "testName": "Woooooow",
    "description": "Yes"
  },
  {
    "id": 5,
    "testName": "LowKik",
    "description": "Yes"
  },
  {
    "id": 6,
    "testName": "Low",
    "description": "Yes"
  }
]}

const questions = TestData.lol.map(item => {
  const res = [];
  res.push(item.id, item.testName)
  return (res);
});

console.log({questions});

let listTests = [];
let l=0;
for (let i of questions) {
  if(l<3){
    listTests.push(<div>
      <img src={'./img/TestPic.png'} alt="" className="TestImg" />
      <div class="ImgSign">{i[1]}</div>
      </div>)
      l++;
  }else{
    <div/>
    l=0;
  }
}



export const TestPage = () => {
    return (
      <div className='Content'>
        <div className="Test">
        <div className="GalleryTest">
            <div className="GalleryHeader">
                <h2>Галерея шаблонов</h2>
                <p>Выберите шаблон или нажмите "Начать с нуля",чтобы создать тест</p>
            </div>
            <div className="GalleryBody">
                <p>Все шаблоны</p>
                <p>Психологические</p>
                <p>Логические</p>
                <p>Ассоциативные</p>
            </div>
        </div>
        <div className="TestMain">
            <h1>Создай тест</h1>
            <Link to = '/createtest' style = {{"textDecoration" : "none", "color": "#000 !important"}}>
            <button> + Начать с нуля</button>
            </Link>
            <div className="Tests">
              {listTests}
            </div>
        </div>
        </div>
      </div>
    )
  }
